tParagraphCxSpLast" style="mso-add-space: auto; text-align: justify; text-indent: 18.0pt; line-height: 115%; margin: 0cm 0cm .0001pt 54.0pt;"><span style="font-size: 12.0pt; line-height: 115%; font-family: ''Times New Roman'',serif;">Beberapa fasilitas penunjang yang diberikan oleh Tirta Agung Mas adalah Toilet, Kamar Bilas, Locker barang berharga, Locker pakaian, Mushola, Pendopo, Kantin, Ruang Senam dan Fitness Center. Pada Maret 2009 Tirta Agung Mas meresmikan wahana terbaru yaitu outbound. Ditunjang dengan permainan nya yang lengkap dan juga pemandangan alam yang memikat hati menjadikan tempat ini sebagai tempat terfavorit bagi keluarga untuk menghabiskan hari libur.</span></p>\r\n<p>&nbsp;</p>', './gambar/tirtaagungmas.jpg');
