ext-align: justify; text-indent: 18.0pt; line-height: 115%; margin: 0cm 0cm .0001pt 54.0pt;"><span style="font-size: 12.0pt; line-height: 115%; font-family: ''Times New Roman'',serif;">&nbsp;</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 36.0pt; line-height: 115%; margin: 0cm 0cm .0001pt 18.0pt;"><span style="font-size: 12.0pt; line-height: 115%; font-family: ''Times New Roman'',serif;">Harga Tiket Masuk :</span></p>\r\n<p class="MsoListParagraphCxSpFirst" style="mso-add-space: auto; text-align: justify; text-indent: -18.0pt; line-height: 115%; mso-list: l0 level1 lfo1; margin: 0cm 0cm .0001pt 72.0pt;"><span style="font-size: 12.0pt; line-height: 115%; mso-bidi-font-family: Calibri;"><span style="mso-list: Ignore;">-<span style="font: 7.0pt ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style="font-size: 12.0pt; line-height: 115%; font-family: ''Times New Roman'',serif;">Senin- Jum&rsquo;at : Rp. 18.000,-</span></p>\r\n<p class="MsoListParagraphCxSpLast" style="mso-add-space: auto; text-align: justify; text-indent: -18.0pt; line-height: 115%; mso-list: l0 level1 lfo1; margin: 0cm 0cm .0001pt 72.0pt;"><span style="font-size: 12.0pt; line-height: 115%; mso-bidi-font-family: Calibri;"><span style="mso-list: Ignore;">-<span style="font: 7.0pt ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style="font-size: 12.0pt; line-height: 115%; font-family: ''Times New Roman'',serif;">Sabtu-Minggu : Rp. 20.000,-</span></p>\r\n<p>&nbsp;</p>', './gambar/mountain.jpg');
