Table 6 Colorful Accent 6"/>\r\n  <w:LsdException Locked="false" Priority="52"\r\n   Name="List Table 7 Colorful Accent 6"/>\r\n  <w:LsdException Locked="false" SemiHidden="true" UnhideWhenUsed="true"\r\n   Name="Mention"/>\r\n  <w:LsdException Locked="false" SemiHidden="true" UnhideWhenUsed="true"\r\n   Name="Smart Hyperlink"/>\r\n  <w:LsdException Locked="false" SemiHidden="true" UnhideWhenUsed="true"\r\n   Name="Hashtag"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:"Table Normal";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-parent:"";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin:0cm;\r\n	mso-para-margin-bottom:.0001pt;\r\n	mso-pagination:widow-orphan;\r\n	font-size:10.0pt;\r\n	font-family:"Calibri",sans-serif;\r\n	mso-bidi-font-family:"Times New Roman";}\r\n</style>\r\n<![endif]--></p>\r\n<p class="MsoListParagraphCxSpFirst" style="mso-add-space: auto; text-align: justify; text-indent: 18.0pt; line-height: 115%; margin: 0cm 0cm .0001pt 54.0pt;"><span style="font-size: 12.0pt; line-height: 115%; font-family: ''Times New Roman'',serif;">Curug Putri Kuningan&nbsp;adalah curug indah di Kawasan Taman Nasional Gunung Ciremai. Jalan menuju tempat ini berkelok dan menanjak, seperti menaiki gunung, karena memang lokasinya tepat di kaki gunung Ciremai. Palutungan, dalam bahasa Sunda berarti sarang monyet.</span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="mso-add-space: auto; text-align: justify; text-indent: 18.0pt; line-height: 115%; margin: 0cm 0cm .0001pt 54.0pt;"><span style="font-size: 12.0pt; line-height: 115%; font-family: ''Times New Roman'',serif;">Palutungan ini biasanya banyak di gunakan orang sebagai bumi perkemahan. Selain digunakan sebagai bumi perkemahan. Lokasinya dekat pos jaga, tempat pengunjung membayar karcis masuk ke kawasan ini. Akses mudah, ketinggian lumayan, dan debet air baik, menjadikan Curug Putri layak dikunjungi. Alamat curug putri itu sendiri di Desa Cisantana, Kecamatan Cigugur, Kabupaten Kuningan, Jawa Barat.</span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="mso-add-space: auto; text-align: justify; text-indent: 18.0pt; line-height: 115%; margin: 0cm 0cm .0001pt 54.0pt;"><span style="font-size: 12.0pt; line-height: 115%; font-family: ''Times New Roman'',serif;">Alasan di beri nama curug putri adalah karena air terjun ini menyerupai putri. Apalagi jika di foto dengan slow speed akan terlihat jelas penampakan putrinya. Air terjun di Curug Putri ini sangat jernih dan katanya juga memiliki khasiat mistis, yaitu mempermudah jodoh. Namanya juga katanya. Ketinggian air terjun cukup tinggi sekitar 40 meter. Badan akan menggigil ketika dekat dengan curug ini karena sangat dingin.</span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="mso-add-space: auto; text-align: justify; text-indent: 18.0pt; line-height: 115%; margin: 0cm 0cm .0001pt 54.0pt;"><span style="font-size: 12.0pt; line-height: 115%; font-family: ''Times New Roman'',serif;">Di hari libur, curug ini banyak dikunjungi oleh kaum muda yang sekadar berfoto, jalan-jalan sekalian cari gebetan, atau keluarga yang sengaja mampir untuk berwisata. Selain alamnya yang asri, di tempat ini ada banyak makanan dijual, seperti jagung bakar sebagai makanan khasnya.</span></p>\r\n<p class="MsoListParagraphCxSpLast" style="mso-add-space: auto; text-align: justify; text-indent: 18.0pt; line-height: 115%; margin: 0cm 0cm .0001pt 54.0pt;"><span style="font-size: 12.0pt; line-height: 115%; font-family: ''Times New Roman'',serif;">&nbsp;</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 36.0pt; line-height: 115%; margin: 0cm 0cm .0001pt 18.0pt;"><span style="font-size: 12.0pt; line-height: 115%; font-family: ''Times New Roman'',serif;">Harga Tiket Masuk :<span style="mso-spacerun: yes;">&nbsp; </span>Rp. 7.500,-</span></p>', './gambar/Curug_putri4.jpg');

